import React from "react";

useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/todos")
      .then((response) => response.json())
      .then((json) => setData(json));
  }, []);

export default function PaginationComponent(){
    return(
        <div>To do List</div>
    )
}
